$(document).ready(function(){$window=$(window),$(".parallax").each(function(){var a=$(this);$(window).scroll(function(){var b=-($window.scrollTop()*a.data("speed")),c="center "+b+"px";a.css({backgroundPosition:c})})}),$(function(){$("body").on("click",".page-scroll a",function(a){var b=$(this);$("html, body").stop().animate({scrollTop:$(b.attr("href")).offset().top},1500,"easeInOutExpo"),a.preventDefault()})})});